import React from 'react';
import '../../App.css';
import PaletteIcon from '@material-ui/icons/Palette';
import PersonIcon from '@material-ui/icons/Person';
import SettingsIcon from '@material-ui/icons/Settings';
import SettingsInputAntennaIcon from '@material-ui/icons/SettingsInputAntenna';
import LinkOffIcon from '@material-ui/icons/LinkOff';
import PeopleAltIcon from '@material-ui/icons/PeopleAlt';
import GroupIcon from '@material-ui/icons/Group';
import LocalShippingIcon from '@material-ui/icons/LocalShipping';
import TextsmsIcon from '@material-ui/icons/Textsms';
import PaymentIcon from '@material-ui/icons/Payment';
import AcUnitIcon from '@material-ui/icons/AcUnit';
import AssessmentIcon from '@material-ui/icons/Assessment';
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';



export const SideBarNavs = [
    {
        title: "Dashboard",
        icon: <PaletteIcon />,
        link: "/dashboard"

    },

    {
        title: "Update Profile",
        icon: <PersonIcon />,
        link: "/update"

    },


    {
        title: "System Settings",
        link: "/settings",
        icon: <SettingsIcon />,
        iconClosed:<ArrowDownwardIcon />,
        iconOpened:<ArrowUpwardIcon />,

        subNav:[
            {
                title: "Mail Settings",
                icon: <PersonIcon />,
                link: "/update"
        
            },

            {
                title: "General Settings",
                icon: <PersonIcon />,
                link: "/update"
        
            },
            {
                title: "Subscription Plan",
                icon: <PersonIcon />,
                link: "/update"
        
            },
            {
                title: "Permission",
                icon: <PersonIcon />,
                link: "/update"
        
            },
            {
                title: "Role",
                icon: <PersonIcon />,
                link: "/update"
        
            },
            {
                title: "Plan",
                icon: <PersonIcon />,
                link: "/update"
        
            },
        ]

    },

    {
        title: "All Users",
        icon: <SettingsInputAntennaIcon />,
        link: "/users"

    },
    {
        title: "Referal Logs",
        icon: <LinkOffIcon />,
        link: "/referal"

    },
    {
        title: "Patient Dashboard",
        icon: <PersonIcon />,
        link: "/patient"

    },
    {
        title: "Providers Dashboard",
        icon: <PeopleAltIcon />,
        link: "/provide"
    },
    {
        title: "Partners Dashboard",
        icon: <GroupIcon />,
        link: "/partner"

    },
    {
        title: "Hospital Dashboard",
        icon: <LocalShippingIcon />,
        link: "/Hospital"
    },
    {
        title: "Laboratory Dashboard",
        icon: <PaletteIcon />,
        link: "/laboratory"

    },
    {
        title: "Pharmacy Dashboard",
        icon: <PaletteIcon />,
        link: "/pharmacy"

    },
    {
        title: "User Benefit",
        icon: <PaletteIcon />,
        link: "/benefit"

    },
    {
        title: "Loans",
        icon: <SettingsIcon />,
        link: "/loans"

    },
    {
        title: "Shop",
        icon: <PaletteIcon />,
        link: "/shop"

    },
    {
        title: "Review",
        icon: <LocalShippingIcon />,
        link: "/review"

    },
    {
        title: "Withdraws",
        icon: <PaletteIcon />,
        link: "/withdraw"

    },
    {
        title: "Appointments",
        icon: <LocalShippingIcon />,
        link: "/appointment"

    },

    {
        title: "Call Logs",
        icon: <PaletteIcon />,
        link: "/call_log"

    },

    {
        title: "Consultation",
        icon: <LocalShippingIcon />,
        link: "/consult"

    },

    {
        title: "Consultation Transaction",
        icon: <LocalShippingIcon />,
        link: "/consulTransaction"

    },

    {
        title: "Order Logs",
        icon: <LocalShippingIcon />,
        link: "/order_logs"

    },

    {
        title: "Analytics",
        icon: <AssessmentIcon />,
        link: "/analystics"
    },

    {
        title: "Bulk Emails",
        icon: <PaletteIcon />,
        link: "/bulk_emails"

    },
    {
        title: "Bulk Sms",
        icon: <TextsmsIcon />,
        link: "/bulk_sms"
    },
    {
        title: "Transactions",
        icon: <PaymentIcon />,
        link: "/transaction"
    },
    {
        title: "Support",
        icon: <PaymentIcon />,
        link: "/support"

    },
    {
        title: "Activity Logs",
        icon: <AcUnitIcon />,
        link: "/activity_log"
    }

]
